description:
Winterstilte (2008) Alternatieve titel: Winter Silence 

Nederland
Drama
70 minuten

geregisseerd door Sonja Wyss
met Gerda Zangger, Brigitta Weber en Sandra Utzinger

In een ingesneeuwde blokhut leven een weduwe en haar vier volwassen dochters met hun verlangens naar liefde en intimiteit. Het sterke katholieke geloof en een al jaren durende rouwfase dwingen hen tot een leven van kuisheid. Geheimzinnige hertmannen brengen verandering in hun bestaan.

Subs optional: Dutch, English, French.
